import React, {useState} from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
    const [click, setClick] = useState(false);
    const [button, setButton] = useState(true);

    const handleClick = () => setClick(!click);
    const closeMobileMenu = () => setClick(false);

    const showButton = () => {
        if(window.innerWidth <= 960) {
            setButton(false);
        } else {
            setButton(true);
        }
    };

    window.addEventListener('resize', showButton);

    return (
        <>
            <nav className="navbar">
                <div className="navbar-container">
                    <Link to='/' className="navbar-logo">
                        ATLAS CREATIVE TECHNOLOGIES <i className="fab fa-typo3" />
                    </Link>
                    <div className='menu-icon' onClick={handleClick}>
                        <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
                    </div>
                    <ul> className={click ? 'nav-menu active' : 'nav-menu'}
                        <li className='nav-item'>
                            <Link to='/Home' className='nav-links' onClick={closeMobileMenu}>
                                Home
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/Tech' className='nav-links' onClick={closeMobileMenu}>
                                Tech
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/Resume' className='nav-links' onClick={closeMobileMenu}>
                                Resume
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/TryIt' className='nav-links-links-moile' onClick={closeMobileMenu}>
                                Try It
                            </Link>
                        </li>
                    </ul>
                    {button && <button buttonStyle='btn--outline'>Try It</button>}
                </div>
            </nav>
        </>
    );
}

export default Navbar
